/** Node Service - gRPC API for node operations */
export interface NodeService {
  /** Query operations */
  GetNodeInfo(request: GetNodeInfoRequest): Promise<ApiResponse>;
  GetNodeStatistics(request: GetNodeStatisticsRequest): Promise<ApiResponse>;
  /** Command operations */
  CreateMetadataSnapshot(request: CreateMetadataSnapshotRequest): Promise<ApiResponse>;
  LaunchRepair(request: LaunchRepairRequest): Promise<ApiResponse>;
}

export const NodeServiceServiceName = "node.NodeService";
export class NodeServiceClientImpl implements NodeService {
  private readonly rpc: Rpc;
  private readonly service: string;
  constructor(rpc: Rpc, opts?: { service?: string }) {
    this.service = opts?.service || NodeServiceServiceName;
    this.rpc = rpc;
    this.GetNodeInfo = this.GetNodeInfo.bind(this);
    this.GetNodeStatistics = this.GetNodeStatistics.bind(this);
    this.CreateMetadataSnapshot = this.CreateMetadataSnapshot.bind(this);
    this.LaunchRepair = this.LaunchRepair.bind(this);
  }
  GetNodeInfo(request: GetNodeInfoRequest): Promise<ApiResponse> {
    const data = GetNodeInfoRequest.encode(request).finish();
    const promise = this.rpc.request(this.service, "GetNodeInfo", data);
    return promise.then((data) => ApiResponse.decode(new BinaryReader(data)));
  }

  GetNodeStatistics(request: GetNodeStatisticsRequest): Promise<ApiResponse> {
    const data = GetNodeStatisticsRequest.encode(request).finish();
    const promise = this.rpc.request(this.service, "GetNodeStatistics", data);
    return promise.then((data) => ApiResponse.decode(new BinaryReader(data)));
  }

  CreateMetadataSnapshot(request: CreateMetadataSnapshotRequest): Promise<ApiResponse> {
    const data = CreateMetadataSnapshotRequest.encode(request).finish();
    const promise = this.rpc.request(this.service, "CreateMetadataSnapshot", data);
    return promise.then((data) => ApiResponse.decode(new BinaryReader(data)));
  }

  LaunchRepair(request: LaunchRepairRequest): Promise<ApiResponse> {
    const data = LaunchRepairRequest.encode(request).finish();
    const promise = this.rpc.request(this.service, "LaunchRepair", data);
    return promise.then((data) => ApiResponse.decode(new BinaryReader(data)));
  }
}

